script: |
  super -f text -I q61.spq | sort > q61.out

inputs:
  - name: q61.spq
    data: |
      SELECT * FROM tab0 (FORMAT parquet) WHERE + - col0 - + - col2 + col0 * + col2 NOT BETWEEN 69 AND 31 * - col1 + 83;
  - name: tab0

outputs:
  - name: q61.out
    data: |
      15	81	47
      87	21	10
      97	1	99
